import { supabase } from "./supabaseClient.js";

const { data, error } = await supabase.storage.createBucket(
  'your-bucket-name',
  {
    // Optional settings:
    // public: true (for public access),
    // allowedMimeTypes: ['image/*'] (restrict upload types),
    // maxFileSize: '1MB' (limit file size),
  }
);

